import { useEffect, useState } from 'react'
import styles from './home.module.css'
import getImages from './getImages'

const Home = () => {
    const [images, setImages] = useState(false)

    useEffect(() => {
        if (!images)
            getImages(setImages)
        else
            document.getElementById('myDiv').appendChild(images)
    })

    console.log(images)

    if (images)
        return (
            <div id='myDiv'>

                <div className={styles.container}>
                    <div className={styles.button}>

                    </div>
                    <div className={styles.button}>

                    </div>
                </div>
            </div>
        )
    return (
        <div>
            CHARGEMENT...
        </div>
    )
}

export default Home
